import * as React from 'react';
import Project1 from '../images/grad.jpg';
import Project2 from '../images/grad.jpg';
import Project3 from '../images/grad.jpg';

const Projects = (props) => {
  return (
    <div className='projects' >
      <h1>Some of my recent Projects</h1>
      <div className='projects-container'>
        <div className="project-card">
          <h3>Project #1</h3>
          <img src={Project1} alt='project #1 demo'/>
          <p>Description #1, here is a bunch of text describing this project emphasising the techonology and the solutions I used</p>
        </div>
        <div className="project-card">
          <h3>Project #2</h3>
          <img src={Project2} alt='project #2 demo' />
          <p>Description #2, here is a bunch of text describing this project emphasising the techonology and the solutions I used</p>
        </div>
        <div className="project-card">
          <h3>Project #3</h3>
          <img src={Project3} alt='project #3 demo' />
          <p>Description #3, here is a bunch of text describing this project emphasising the techonology and the solutions I used</p>
        </div>
      </div>
    </div>
  );
}
export default Projects;
